  02> SHERRIFF, Karl Fraser
  b 13.04.1972
  Karl 6. at Gisborne. Address: 35 Marne Street, Palmerston North.
  Karl attended Palmerston North Boys' High School and is now working for Westpac Trust in
  Palmerston North.
  03> SHERRIFF, Dudley Patrick
  b 23.07.1974
  Patrick b. at Gisborne. Address: Ohinewairua Station, Pte Bag, Taihape.
  Patrick was educated at Palmerston North Boys' High School. He worked as a shepherd at Aerial
  Station, Gisborne for three years and is now head shepherd on Ohinewairua Station.
  02> SHERRIFF, David William m on 05.11.1967 to (1)De COSTA, Anna Mathea
  b 15.05.1942
  b ** ** ****
  David b. and m. at Gisborne. Divorced 1982. Anna is remarried to Derek Galloway and they are
  orchardists and packhouse operators in Hastings.
  01> SHERRIFF, Nigel Dudley
  b 15.11.1974
  Nigel attended Lindisfarne College then worked at agricultural contracting before going
  overseas.
  • SHERRIFF, Paul William
  b 26.05.1978
  Paul attended Lindisfarne College and Dannevirke High School.
  02> SHERRIFF, David William m on 29.10.1988 to (2) MCCARTHY, Brigid Joan
  Pearcey
  b 15.05.1942
  b 25.10.1953
  David m. at Gisborne. Brigid, d/o Rt Hon Sir Thaddeus Pearcey McCarthy and Joan Margaret Miller, b.
  at Wellington. Address: "Rawiri", RD Matawai, Gisborne.
  In his younger days David worked at Waiau, Ihungia and Mount Linton Stations. After his marriage
  he managed Bushy Knoll Station for eight years prior to acquiring a 561-ha property at Matawai
  through the Lands and Survey Settlement Scheme.
  David has been a Federated Farmers branch chairman, President of the Poverty Bay centre of the New
  Zealand Sheep Dog Trial Association and President of the Poverty Bay Agricultural and Pastoral
  Association.
  03> SHERRIFF, John Richard m on 21.04.1973 to WINCHCOMBE, Ngaire Frances
  b 12.02.1944
  b 03.03.1949
  John b. at Gisborne and m. at Taihape. Ngaire, d/o Montague William Winchcombe and
  Dulcie Margaret Donald, b. at Taihape. Address: Braemar Road, RD 2, Whakatane.
  John was raised at Mangaheia Station, Tolaga Bay, and educated at Gisborne Boys'
  High School. He served as a platoon commander in 7 Wellington and Hawkes Bay
  Territorial Force Regiment, and then joined the New Zealand Regular Army in 1967.
  He served overseas for five years, including two tours of service in South Vietnam.
  During the first tour he was wounded and evacuated after being shot in the leg. After specialising
  in Training Systems, John became the Officer Commanding of Training Methods School at Waiouru with
  the rank of Major. He resigned in 1980 to establish a family home in the Bay of Plenty.
